                    <div class="card mb-3">
  <img class="card-img-top" src="https://people.com/thmb/QnP-eclt4ewUOYyBaWRQkm6DWvM=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc():focal(999x0:1001x2)/hsus_photo_485458-2000-24a48d6d74204d7484fbfc8b864a6276.jpg" alt="Card image cap">
  <div class="card-body">
    <h5 class="card-title">From the Streets to a Loving Home: The Story of Max</h5>
    <p class="card-text">Max, a scruffy, emaciated terrier mix, was found wandering the streets with a matted coat and no visible signs of care. Rescued by Strays Worth Saving, Max was immediately given a thorough medical examination and a nourishing diet to help him recover. After several weeks of treatment and a lot of tender care, Max’s transformation was remarkable. His fur grew back thick and shiny, and his once-sad eyes sparkled with newfound joy. It wasn’t long before Max was adopted by a loving family who had been searching for a companion. Today, Max enjoys a cozy home with a big backyard to run in and a family who adores him. His journey from a stray to a cherished pet is a testament to the power of rescue and rehabilitation.</p>
    <p class="card-text"><small class="text-muted">One Stray at a time</small></p>
  </div>
</div>


<div class="card mb-3">
  <img class="card-img-top" src="https://diamondpet.storage.googleapis.com/wp-content/uploads/2023/02/06151608/dog-giving-paw-042418.jpg" alt="Card image cap">
  <div class="card-body">
    <h5 class="card-title">A New Beginning for Luna: Overcoming the Odds</h5>
    <p class="card-text">Luna, a gentle calico cat, was found abandoned in a cardboard box on a rainy day. She was malnourished and suffering from an upper respiratory infection. Strays Worth Saving took Luna in and provided the medical care she desperately needed. After months of treatment and a warm foster home, Luna’s health improved dramatically. Her sweet personality and playful nature won over the hearts of everyone who met her. Luna’s story took a heartwarming turn when she was adopted by a family with young children who instantly fell in love with her. Now, Luna lives a happy, comfortable life, cherished as a beloved family member, proving that even the smallest acts of kindness can lead to profound changes.</p>
    <p class="card-text"><small class="text-muted">One Stray at a time</small></p>
  </div>
</div>


<div class="card mb-3">
  <img class="card-img-top" src="https://nationaltoday.com/wp-content/uploads/2021/05/National-Rescue-Dog-Day-1-1200x834.jpg" alt="Card image cap">
  <div class="card-body">
    <h5 class="card-title">From Neglect to Nurture: The Transformation of Buddy</h5>
    <p class="card-text">Buddy, a large mixed-breed dog, was discovered in an abandoned property, neglected and alone. His previous living conditions left him fearful and untrusting of people. Strays Worth Saving took Buddy in, working tirelessly to build his confidence and trust through patient training and socialization. With time, Buddy’s fear transformed into joy as he learned to trust and enjoy human companionship. His progress was so inspiring that he was featured in one of our adoption events, where he met his new owner, a retired veteran looking for a loyal companion. Buddy now thrives in a loving home, enjoying daily walks and playtime, embodying the hope and success that Strays Worth Saving strives to achieve with every animal we rescue.</p>
    <p class="card-text"><small class="text-muted">One Stray at a time</small></p>
  </div>
